import './styles.css';
// Component imports
import Header from './components/header';
function App() {
  return (
    <div className="App" style={styles.app}>
      <main style={styles.mainCont}>
        <Header />
      </main>
      <div className="app-background"></div>
    </div>
  );
}
const styles={
  app:{
    display: 'flex',
    justifyContent: 'center',

  },
  mainCont:{
    width: '100%',
    maxWidth: '1200px',


  }
}
export default App;
